export const TopNavItems = [
  {
    title: "Search",
    url: "#", // Goes nowhere right now
    cName: "nav-links",
  },
  {
    title: "Messages", // <i class="fas fa-location-arrow"></i>
    url: "#",
    cName: "nav-links",
  },
  {
    /**
     * Use either of these, whichever is better:
     * <i class="far fa-bell"></i>
     * <i class="fas fa-bell"></i>
     *
     *
     */
    title: "Notifications",
    url: "#",
    cName: "nav-links",
  },
  {
    title: "Stories", // Maybe
    url: "#",
    cName: "nav-links",
  },
  {
    /**
     * Any of these 3:
     * <i class="far fa-plus-square"></i>
     * <i class="fas fa-plus"></i>
     * <i class="fas fa-folder-plus"></i>
     *
     */
    title: "Add Post", // Maybe
    url: "#",
    cName: "nav-links",
  },
];
